/*global chrome*/
import React from "react";

const Test = () => {
  alert(chrome);
  var text = "";
  chrome.storage.local.get("text", function(data) {
    text = data.text;
  });
  return (
    <textarea class="textarea" placeholder="e.g. Hello world">
      {text}
    </textarea>
  );
};

export default Test;
